import React from 'react';
import './Profile2.css';
import Avatar from '../Images/avatar_prueba.jpg';
import BgImg from '../Images/wildrift.jpg';

export default function Profile2() {
    return (
        <div>
            <div className="profileHeader">
                <div>
                    <img className="avatar" src={Avatar} alt="avatar" width="100px" height="100px"/>
                </div>
                <div>
                    <img src={BgImg} alt="bg-img" width="100%"/>
                </div>
                <div>

                </div>
            </div>
        </div>
    )
}
